// Função para criar chunks de mensagens para RAG (remetente: mensagem + metadados)
function createMessageChunks(input) {
	try {
		const rawData = input[0].data;
		const messageLines = rawData.trim().split('\n');

		const messages = messageLines.map(line => {
			try {
				return JSON.parse(line);
			} catch (error) {
				console.error('Erro ao parsear linha:', line);
				return null;
			}
		}).filter(msg => msg !== null);

		const chunkSize = 5;
		const stepSize = 3;
		const chunks = [];

		for (let i = 0; i < messages.length; i += stepSize) {
			const chunk = messages.slice(i, i + chunkSize);

			if (chunk.length > 0) {
				const textContent = chunk.map(msg =>
					`${msg.remetente}: ${msg.mensagem}`
				).join('\n');

				chunks.push({
					chunkId: Math.floor(i / stepSize),
					startIndex: i,
					endIndex: Math.min(i + chunkSize - 1, messages.length - 1),
					messageCount: chunk.length,
					textContent: textContent,
					metadata: {
						dateRange: {
							start: chunk[0].data,
							end: chunk[chunk.length - 1].data
						},
						participants: [...new Set(chunk.map(msg => msg.remetente))],
						totalMessages: chunk.length
					}
				});
			}
		}

		return chunks;

	} catch (error) {
		console.error('Erro ao processar chunks:', error);
		return [{ error: 'Erro ao processar os dados', details: error.message }];
	}
}

// Entrada no n8n
const input = [
	{
		data: $json.data
	}
];

// Processa os chunks
const chunks = createMessageChunks(input);

// Retorna uma lista de chunks como itens
return chunks.map(chunk => ({ json: chunk }));

// Loop over input items and add a new field called 'myNewField' to the JSON of each one
for (const item of $input.all()) {
  item.json.myNewField = 1;
}

return $input.all();

