// Entrada: dois fluxos anteriores conectados (BM25 + Vetorial)
const bm25Results = items.filter(i => i.json.score_bm25 !== undefined);
const vectorResults = items.filter(i => i.json.score_vector !== undefined);

// Índices por ID
const vectorMap = {};
vectorResults.forEach(item => {
  vectorMap[item.json.id] = item.json;
});

// Mescla e calcula score combinado
const merged = bm25Results.map(item => {
  const id = item.json.id;
  const bm25 = item.json.score_bm25 || 0;
  const vector = vectorMap[id]?.score_vector || 0;

  // Normalize (opcional): você pode usar z-score, min-max ou deixar bruto
  const hybridScore = (bm25 * 0.4) + (vector * 0.6); // ajuste os pesos

  return {
    json: {
      id,
      title: item.json.title,
      content: item.json.content,
      score_bm25: bm25,
      score_vector: vector,
      score_total: hybridScore
    }
  };
});

// Ordena por score_total
merged.sort((a, b) => b.json.score_total - a.json.score_total);

return merged;

const normalizeText = (text) => {
  return text
    .split('\n') // separa cada linha de fala
    .map(line => {
      const parts = line.split(':');
      if (parts.length >= 2) {
        const speaker = parts[0]
          .toLowerCase()
          .normalize("NFD").replace(/[\u0300-\u036f]/g, "")
          .trim();

        const message = parts.slice(1).join(':')
          .toLowerCase()
          .normalize("NFD").replace(/[\u0300-\u036f]/g, "")
          .replace(/[^\w\s]/g, "") // remove pontuação da mensagem
          .replace(/\s+/g, " ")
          .trim();

        return `${speaker}: ${message}`;
      } else {
        // caso seja uma linha sem ":", apenas normaliza
        return line
          .toLowerCase()
          .normalize("NFD").replace(/[\u0300-\u036f]/g, "")
          .replace(/[^\w\s]/g, "")
          .replace(/\s+/g, " ")
          .trim();
      }
    })
    .join('\n');
};

return items.map(item => {
  const normalized = normalizeText(item.json.textContent);

  return {
    json: {
      ...item.json,
      textContent_normalized: normalized
    }
  };
});
